// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

contract SwearIT {
    struct Product {
        uint256 productId;
        string productName;
        bytes32 createdAt;
        uint256 organizationId;
        string organizationName;
        string productUrl;
    }

    struct Milestone {
        uint256 productId;
        uint256 milestoneId;
        string milestoneName;
        bytes32 createdAt;
        uint256 userId;
        Proof proofs;
        bool completed;
    }

    struct Proof {
        uint256 proofId;
        string proofName;
        uint256 organizationId;
        string evidences;
        string conditions;
        bytes32 createdAt;
        uint256 userId;
    }

    mapping(uint256 => Product) public products;
    mapping(uint256 => Milestone) public milestones;
    mapping(uint256 => Proof) public proofs;

    address public owner;
    string public orgName;

    // Add an array to keep track of product IDs
    uint256[] public productIds;
    uint256[] public milestoneIds;
    Proof[] public initProofs;

    constructor(string memory _name) {
        owner = msg.sender;
        orgName = _name;
    }

    modifier transferOwner() {
        require(
            owner == msg.sender,
            "Only the current owner can perform this action"
        );
        _;
    }

    function createProduct(
        uint256 _productId,
        string memory _productName,
        bytes32 _createdAt,
        uint256 _organizationId,
        string memory _organizationName,
        string memory _productUrl
    ) public {
        products[_productId] = Product(
            _productId,
            _productName,
            _createdAt,
            _organizationId,
            _organizationName,
            _productUrl
        );

        // Add product ID to the array
        productIds.push(_productId);
    }

    function createMilestone(
        uint256 _productId,
        uint256 _milestoneId,
        string memory _milestoneName,
        bytes32 _createdAt,
        uint256 _userId
    ) public {
        require(
            products[_productId].productId == _productId,
            "Product does not exist"
        );

        proofs[0] = Proof(1, "", 1, "", "", _createdAt, _userId);
        milestones[_milestoneId] = Milestone(
            _productId,
            _milestoneId,
            _milestoneName,
            _createdAt,
            _userId,
            proofs[0],
            false // Milestone is initially incomplete
        );
        milestoneIds.push(_milestoneId);
    }

    function getProductById(uint256 _productId)
        public
        view
        returns (Product memory)
    {
        require(
            products[_productId].productId == _productId,
            "Product does not exist"
        );

        return products[_productId];
    }

    function getAllProducts() public view returns (Product[] memory) {
        Product[] memory allProducts = new Product[](productIds.length);

        for (uint256 i = 0; i < productIds.length; i++) {
            allProducts[i] = products[productIds[i]];
        }

        return allProducts;
    }

    function transferOwnership(address newOwner) public transferOwner {
        owner = newOwner;
    }
}

